import React from 'react';
import logo from './img/Azakana_logo.png';
import Navbar from './components/Navbar';
import './App.css';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';

function App() {
  return (
    <>
      <Router>
        <Navbar />
          <Switch>
            <Route path='/' />
          </Switch>
      </Router>
    </>
  );
}

export default App;
